import React from 'react';
import { withStyles } from "@material-ui/styles";
import Icon from "@material-ui/core/Icon";

const styles = {
  root: {
    paddingTop: "120px",
    paddingBottom: "240px",
    boxSizing: "border-box"
  },
  h1: {
    margin: "0px",
    color: "white",
    opacity: "0.6"
  },
  p1: {
    padding: "16px 0px",
    color: "white",
    fontSize: "16px",
    opacity: "0.6"
  },
  section: {
    display: "flex",
    alignItems: "center",
    boxSizing: "border-box"
  },
  socialMedias:{
    display: "flex",
    alignItems:"center"
  }
}

function Footer(props) {
  const { classes } = props;
  return (
    <div className={classes.root}>

      <div className={classes.section}>
        <div>
          <h1 className={classes.h1}>About</h1>
        </div>
        <div>
          <p className={classes.p1}>
            I also open to freelancer job.
            If you want to coorperate with me, please feel free to  contact me!
          </p>
        </div>
      </div>

      <div className={classes.section}>
        <div>
          <h1 className={classes.h1}>Contact</h1>
        </div>
        <div className={classes.socialMedias}>
          <Icon className="fab fa-linkedin-in" style={{ color: "white",padding:"0px 20px" }} />
          <Icon className="fab fa-github" style={{ color: "white" }} />
          <Icon className="fab fa-instagram" style={{ color: "white" }} />
          <Icon className="fab fa-dribbble" style={{ color: "white" }} />
        </div>
      </div>

    </div>
  )
}

export default withStyles(styles)(Footer);
